create table pembayaranbaju(
ID_Pembayaran_Baju int not null,
NISN int not null,
Nama_Siswa varchar(50) not null,
Id_Kelas int not null,
Kelas varchar(10) not null,
Jurusan varchar(10) not null,
Jenis_Kelamin enum('Perempuan', 'Laki-laki'),
Ukuran_Baju varchar(5) not null,
Jumlah_Pembayaran varchar(30) not null,
Tanggal_Pembayaran varchar(30) not null,
Status enum('Lunas', 'Belum Lunas'),
NIP_Admin int not null,
Nama_Admin varchar(30) not null,
primary key (ID_Pembayaran_Baju)
);

desc pembayaranbaju;


select*from pembayaranbaju;